import React, { Component } from 'react'
import MainContainer1 from './mainContainer1'
import MainContainer2 from './mainComponent2'
// import './actionComponentCSS.css'
import './postButtonCSS.css'

class ActionComponent extends Component {

    constructor(props) {
        super(props)

        this.state = {
             comp1: true,
             comp2: false,
             comp3: false
        }
    }

    render() {
        return (
            <div>
                <div>
                {
                    this.state.comp1 && 
                    <div>
                     <MainContainer1 />
                     <button className='buttonStyle'>OLDER POSTS</button>
                     </div>
                    }

                </div>

                <div>
                {
                    this.state.comp2 && 
                    <div> <MainContainer2 />
                    <button >NEWER POSTS</button>
                    <button>OLDER POSTS</button>
                    </div>
                }

                </div>
                </div>
        )
    }
}

export default ActionComponent
